import React from "react";
import Articles from "./components/Articles/Articles";
import Navbar from "./components/Navbar/Navbar";
import Quote from "./components/Quote/Quote";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Quote />
      <Articles />
    </div>
  );
}

export default App;
